import React, { useRef } from 'react'
import { useMapAreaHandlers, useMapFieldsHandlers } from './utils'
import Viewer from './Viewer'
import styled from 'styled-components'
import { Card } from '../../common'
import BackLink from '../BackLink'

import Field1 from './fields/Field1'
import Field2 from './fields/Field2'
import Field3 from './fields/Field3'
import Field4 from './fields/Field4'
import Field5 from './fields/Field5'
import Field6 from './fields/Field6'
import Field7 from './fields/Field7'
import Field8 from './fields/Field8'
import Field9 from './fields/Field9'
import Field10 from './fields/Field10'
import Field11 from './fields/Field11'
import Field12 from './fields/Field12'

export default function Map({
  areaLabel,
  area,
  field,
  onOpenArea,
  onOpenField,
  onClose,
  summary,
}) {
  const filterStyles = () => {
    if (!summary?.fields) return ''
    const selector = summary.fields.map((id) => 'path#' + id).join(', ')
    const styles = `${selector} {fill: #407cff;}`
    return <style>{styles}</style>
  }
  return (
    <MapCard>
      {filterStyles()}
      {area && <BackLink action={onClose} />}
      {area ? (
        <AreaMap
          area={area}
          areaLabel={areaLabel}
          field={field}
          onOpen={(v) => onOpenField(v)}
          onClose={onClose}
          summary={summary}
          // fields={summary?.fields || []}
        />
      ) : (
        <AllMap
          onOpen={(v) => onOpenArea(v)}
          fields={summary?.fields || []}
          areaLabel={areaLabel}
        />
      )}
    </MapCard>
  )
}

const MapCard = styled(Card)`
  position: relative;
  display: flex;
  justify-content: center;
  align-items: center;
  flex-grow: 1;
  padding: 48px 32px;

  svg {
    position: relative;
    margin: auto;
    display: block;

    & > g:not(#lakes) {
      position: relative;
      z-index: 100;
      transition: all 0.3s;
      clip-rule: evenodd;
      cursor: pointer;
    }
  }
`

export function AreaMap({ area, onOpen, field, onClose, summary, areaLabel }) {
  const ref = useRef()
  useMapFieldsHandlers(
    ref,
    (e) => onOpen(e.currentTarget.id),
    field,
    field ? [] : summary?.fields || []
  )
  const renderField = () => {
    switch (area) {
      case '1':
        return <Field1 ref={ref} />
      case '2':
        return <Field2 ref={ref} />
      case '3':
        return <Field3 ref={ref} />
      case '4':
        return <Field4 ref={ref} />
      case '5':
        return <Field5 ref={ref} />
      case '6':
        return <Field6 ref={ref} />
      case '7':
        return <Field7 ref={ref} />
      case '8':
        return <Field8 ref={ref} />
      case '9':
        return <Field9 ref={ref} />
      case '10':
        return <Field10 ref={ref} />
      case '11':
        return <Field11 ref={ref} />
      case '12':
        return <Field12 ref={ref} />
      default:
        return ''
    }
  }

  return (
    <>
      {areaLabel && <AreaLabel>Поле № {areaLabel.name}</AreaLabel>}
      <Viewer small={!!field}>{renderField()}</Viewer>
    </>
  )
}

export function AllMap({ onOpen, areaLabel }) {
  const ref = useRef()
  useMapAreaHandlers(ref, (e) => {
    if (
      e.type === 'click' &&
      (!areaLabel || areaLabel.path !== e.currentTarget.id)
    )
      return
    onOpen(e.currentTarget.id)
  })
  return (
    <Viewer>
      {areaLabel && <AreaLabel>Поле № {areaLabel.name}</AreaLabel>}
      <MapIcon ref={ref} />
    </Viewer>
  )
}

